(7, 'Missão, Visão e Valores', 'missao-visao-e-valores', '', '<br />\r\n<h3>MISSÃO</h3>\r\n<p>Promover soluções de segurança, higienização de condomínios e empresas, por meio da prestação de serviços, contribuindo para o bem-estar e satisfação de nossos clientes, parceiros e fornecedores.</p>\r\n<h3>VISÃO</h3>\r\n<p>Ser empresa referencial em terceirização de serviços, nos mercados em que atua.</p>\r\n<h3>VALORES</h3>\r\n<p>Excelência nos serviços prestados, Ética e valorização dos funcionários, respeito e responsabilidade com os parceiros, e principalmente com nossos clientes para que possamos contar com a satisfação de todos.</p>\r\n<p> </p>\r\n<h4>Queremos sempre:</h4>\r\n<ul class="checkbox">\r\n<li>Atuar de acordo com a necessidade de nossos clientes;</li>\r\n<li>Oferecer Praticidade, Agilidade e Qualidade;</li>\r\n<li>Atuar com Ética e Responsabilidade;</li>\r\n<li>Prospectar e planejar a expansão para o futuro;</li>\r\n<li>Fidelizar clientes diretos e indiretos;</li>\r\n<li>Desenvolver e investir em pessoal;</li>\r\n<li>Busca tecnologia inovadora para aperfeiçoar a realização de serviços.</li>\r\n</ul>\r\n<p> </p>\r\n<h3>ÉTICA</h3>\r\n<p>A Ética e a integridade norteiam todas as ações e atividades desenvolvidas pela Oriente, nas nossas relações com funcionários, clientes, competidores e fornecedores.</p>', '', 1, 3, 0, 4, '2009-02-12 13:04:02', 62, '', '2010-07-26 17:45:47', 62, 0, '0000-00-00 00:00:00', '2009-02-12 13:04:02', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=0\nshow_create_date=0\nshow_modify_date=0\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 17, 0, 2, '', '', 0, 4135, 'robots=\nauthor='),
