 Praesent vitae sem nisl, eget malesuada neque. Duis nec massa ipsum, vel imperdiet purus. Sed vulputate mattis nunc vel bibendum. Quisque risus ligula, mattis quis imperdiet at, lobortis et eros. Duis facilisis imperdiet ultricies. Sed libero ipsum, condimentum a rutrum sit amet, faucibus at enim. Nam mollis sagittis diam, in aliquet velit sagittis eget. Nam accumsan molestie nulla vitae euismod. Phasellus vulputate scelerisque justo, quis malesuada tellus imperdiet sed. Quisque in tincidunt elit. Donec nunc mauris, sodales at vulputate quis, lacinia in mauris. Aenean eget dignissim mauris.</p>', '', -2, 0, 0, 0, '2010-07-19 18:42:16', 62, '', '2010-07-19 18:44:53', 62, 0, '0000-00-00 00:00:00', '2010-07-19 18:42:16', '0000-00-00 00:00:00', '', '', 'show_title=1\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 3, 0, 0, '', '', 0, 0, 'robots=\nauthor='),
(31, 'Serviços', 'servicos', '', '<p> </p>\r\n<p><strong>ORIENTE O MELHOR PREÇO COM QUALIDADE</strong></p>\r\n<p>Assim a Oriente dispõe de Recursos Humanos com os mais diversos perfis e finalidades, dos quais, destacam-se:</p>\r\n<ul class="star">\r\n<li>Limpeza, Conservação e manutenção predial;</li>\r\n<li>Asseio e Manutenção em Prédios e em Domicílios;</li>\r\n<li>Cessão de Mão de Obra Temporária;</li>\r\n<li>Serviços Domésticos, Copa e Cozinha;</li>\r\n<li>Garçom, Porteiro, Vigia Garagista, Manobrista;</li>\r\n<li>Tratorista, Operador de empilhadeira e retro escavadeira;</li>\r\n<li>Fornecimento de Mao de obra a terceiros;</li>\r\n<li>Controlador de trafego de pedágios;</li>\r\n<li>Operador de caixa, Empacotadores;</li>\r\n<li>Recepcionista, mensageiro, auxiliares administrativos;</li>\r\n<li>Costureira, Cozinheira, Merendeira, Zeladora;</li>\r\n<li>Fornecimento e Gestão de Recursos Humanos p/ Terceiros;</li>\r\n<li>Seleção e Agenciamento de Mão de Obra;</li>\r\n<li>Serviços de Dedetização, Desinsetização, Desratização, Descupinização, Expurgação, Controle de Pragas Urbanas e Agrícolas;</li>\r\n<li>Serviços de Coleta e Transporte de Resíduos Sanitários, Domésticos, Comerciais e Hospitalares p/ Tratamento e Destino Final;</li>\r\n<li>Serviços de Elaboração e Manutenção de Projetos Ambientais,  Serviços de Limpeza de Reservatórios de Água, Poços, Piscinas, Caixas de Água, Caixas de Gordura, Filtros, Fossas, Desentupimentos;  Captura de Mamíferos e Controle de Animais Silvestres, Telamento e Isolamento de Telhados;</li>\r\n<li>Serviços Paisagísticos e de Jardinagem (Plantio, Tratamento e Manutenção de Jardins e Gramados), Roçada, Capina, Capina Química; Limpeza e Conservação de Terrenos, Ruas, Calçadas, Praças; Coleta de Lixo, Galhos e Entulhos; Poda de Árvores e Serviços de Pintura em Geral.</li>\r\n</ul>', '', 0, 3, 0, 4, '2010-07-19 18:57:35', 62, '', '2010-07-19 19:18:23', 62, 0, '0000-00-00 00:00:00', '2010-07-19 18:57:35', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 3, 0, 3, '', '', 0, 34, 'robots=\nauthor='),
(32, 'Qualidade', 'qualidade', '', '<p> </p>\r\n<p><strong>CQ (COEFICIENTE DE QUALIDADE): </strong></p>\r\n<p>Todo o nosso pessoal é incentivado a desenvolver o melhor trabalho. O Grupo Oriente se utiliza de mecanismos de mensuração e motivação trimestrais, através dos quais destaca os profissionais que apresentaram o melhor coeficiente de qualidade e os reconhece através de premiação. Aqueles que apresentam desempenho abaixo dos padrões exigidos pela Oriente passam por reciclagem ou substituição. Esta é apenas uma das formas de manutenção da qualidade dos serviços que prestamos. O Treinamento focado em resultados, na qualificação e aperfeiçoamento de nossos colaboradores é o que primamos para atingir a satisfação de nossos clientes. Através de um contato próximo e maior interação com este mesmo cliente, encontramos a melhor solução para o seu negócio. Estamos sempre buscando no mercado tecnologias inovadoras que possam oferecer soluções de excelência ao nosso parceiro. Também desenvolvemos uma pesquisa semestral de Controle de Qualidade, onde o administrador avalia o serviço prestado e os profissionais, munindo nossa empresa de informações para possíveis melhorias.</p>', '', 1, 3, 0, 4, '2010-07-19 19:07:05', 62, '', '2010-07-26 17:46:40', 62, 0, '0000-00-00 00:00:00', '2010-07-19 19:07:05', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 3, 0, 4, '', '', 0, 22, 'robots=\nauthor='),
(33, 'Vantagens', 'vantagens', '', '<h4><br /></h4>\r\n<h4>O QUE O GRUPO ORIENTE OFERECE PARA VOCÊ:</h4>\r\n<p><span style="color: #ff0000;"><strong>Parceria, Qualidade e Excelência.</strong></span></p>\r\n<p> </p>\r\n<h3>TERCEIRIZAÇÃO</h3>\r\n<p>A terceirização dos serviços mostra-se como opção preferencial de um número cada vez maior de administradores.<br />A liberação da empresa que contrata os serviços para canalizar seus esforços em sua atividade principal, possibilita uma maior eficiência e competitividade no mercado. <br />Permite à empresa focar em suas reais competências, em sua cadeia de valores, investindo tempo, recursos e pessoal na atividade essencial, trazendo maior produtividade e competitividade, delegando à  parceira compromissos com os valores e a estratégia da empresa, suas atividades saudáveis.</p>\r\n<p>Algumas vantagens para estabelecer <strong>PARCERIA COM A ORIENTE</strong></p>\r\n<ul class="arrow">\r\n<li>Previsão orçamentária de custos;</li>\r\n<li>Eliminação de ações trabalhistas;</li>\r\n<li>Eliminação dos custos com demissões, horas extra, folhas de pagamento, etc.;</li>\r\n<li>Eliminação dos custos de equipamentos e manutenção com os mesmos;</li>\r\n<li>Eliminação de compras e estoque de materiais, uniformes, EPIs;</li>\r\n<li>Cobertura imediata de faltas, folgas, férias e demissões;</li>\r\n<li>Inovações tecnológicas do setor;</li>\r\n<li>Orientação técnica por especialistas;</li>\r\n<li>Supervisão permanente dos serviços;</li>\r\n<li>Liberação para canalizar os seus esforços em sua atividade principal.</li>\r\n</ul>\r\n<p> </p>\r\n<p><strong>ALGUMAS EXCELENTES RAZÕES PARA TERCEIRIZAR: </strong></p>\r\n<p>A terceirização ou outsourcing de serviços permite que sua empresa ganhe maior competitividade no mercado, proporcionando ainda os seguintes benefícios:</p>\r\n<ul class="arrow">\r\n<li>Os custos fixos se transformam em variáveis;</li>\r\n<li>Especialização, maior produtividade, melhor qualidade, investimento em técnicas, processos, produtos, maquinários e treinamento;</li>\r\n<li>Simplificação da estrutura de sua empresa, além de redução dos investimentos em infra-estrutura;</li>\r\n<li>Menor custo e maior lucratividade;</li>\r\n<li>Redução do quadro de empregados e, conseqüentemente, dos encargos trabalhistas e sociais, isso sem contar a economia de custos com contratação e treinamento de pessoal;</li>\r\n<li>Redução de riscos trabalhistas - são assumidos pelas empresas terceirizadas;</li>\r\n<li>Controle de qualidade assegurado pelo prestador de serviços, que vai lhe garantir agilidade de decisões;</li>\r\n<li>Controle adequado do estoque, com a racionalização‚ das compras e a redução das perdas;</li>\r\n<li>Cobertura para faltas, licenças, férias, ausências, etc.;</li>\r\n<li>Substituição‚ de funcionários a qualquer tempo, sem envolvimento da empresa na administração pessoal.</li>\r\n</ul>\r\n<p><br />A terceirização é uma parceria, e como tal, exige <strong>RESPONSABILIDADES </strong>definidas e <strong>TRANSPARÊNCIA </strong>nas relações comerciais, obrigações‚e cumprimento da legislação.</p>', '', 1, 3, 0, 4, '2010-07-19 19:08:06', 62, '', '2010-07-26 18:03:44', 62, 0, '0000-00-00 00:00:00', '2010-07-19 19:08:06', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 3, 0, 5, '', '', 0, 31, 'robots=\nauthor='),
(34, 'Clientes', 'clientes', '', 'Em Breve!<br />', '', 1, 0, 0, 0, '2010-07-19 19:13:39', 62, '', '2010-07-26 18:09:42', 62, 0, '0000-00-00 00:00:00', '2010-07-19 19:13:39', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 3, 0, 4, '', '', 0, 26, 'robots=\nauthor='),
(43, 'Disk Serviços', 'disk-servicos', '', 'Em Breve!', '', 1, 0, 0, 0, '2010-07-26 18:12:21', 62, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2010-07-26 18:12:21', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 1, '', '', 0, 4, 'robots=\nauthor='),
(35, 'Perfil', 'perfil', '', '<p>Fundada em Maio de 2005, o GRUPO ORIENTE é uma empresa nascida da vocação de seus administradores, voltada para o desenvolvimento de pessoas para bem servir nas diversas áreas da prestação de serviços de conservação, manutenção, limpeza, higienização, desinsetização, serviços temporários recrutamento e seleção.</p>\r\n<p>A gestão do Grupo Oriente, conta com gerentes já com mais de duas décadas de sólida experiência. A prestação de serviços constitui atualmente sua especialidade, desde o planejamento e aplicação racional de recursos, a tecnologia empregada e principalmente a qualidade dos serviços já são referencia na região.</p>\r\n<p>Um destaque para o Grupo é sua grande capacidade de atendimentos nas mais diversas áreas da prestação dos serviços.</p>\r\n<p>Em termos de qualidade, é inegável seu desempenho o que lhe tem válido um mercado crescente e amplas possibilidades em busca da excelência. Programas de qualidade para satisfação de requisitos dos seus clientes, tanto internos, como externos, engajados com seus parceiros e fornecedores estão em contínua implementação, assistidos por consultorias com larga experiência.</p>', '', 1, 3, 0, 4, '2010-07-25 14:15:01', 62, '', '2010-07-25 18:53:47', 62, 0, '0000-00-00 00:00:00', '2010-07-25 14:15:01', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 2, 0, 1, '', '', 0, 10, 'robots=\nauthor='),
(36, 'Limpeza e Conservação', 'limpeza-e-conservacao', '', 'O <strong>Grupo ORIENTE</strong>, desenvolve projetos voltados a necessidades de seus clientes, elaborando na implantação dos serviços projetos com acompanhamento de profissionais com mais de 20 anos de experiência em processos de terceirização e limpeza eventual (DISK SERVIÇOS).  \r\n<ul class="checkbox">\r\n<li>Serventes de limpeza comercial e Industrial;</li>\r\n<li>Copeira;</li>\r\n<li>Porteiro Industrial e Comercial;</li>\r\n<li>Vigia Industrial, Comercial e Residencial;</li>\r\n<li>Garagista, Manobrista, Comercial e Residencial;</li>\r\n<li>Recepcionista;</li>\r\n</ul>\r\n<p><br /><strong>LIMPEZA EM CONDOMINIOS</strong>:</p>\r\n<p>O <strong>Grupo ORIENTE</strong>, desenvolve projetos voltados a necessidades do CONDOMINIO, com implantação de escalas de limpeza diversificadas dentro dos horários estabelecidos pelo Sindico, seus profissionais são cuidadosamente treinados, nosso departamento social analisa seus antecedentes e vida social, dando assim uma maior confiabilidade na segurança.</p>\r\n<p> </p>\r\n<ul class="checkbox">\r\n<li>PORTARIA;</li>\r\n<li>VIGIA;</li>\r\n<li>ZELADOR;</li>\r\n<li>SERVENTE DE LIMPEZA;</li>\r\n<li>JARDINEIRO;</li>\r\n<li>PISCINEIRO;</li>\r\n</ul>', '', 1, 4, 0, 5, '2010-07-25 14:41:41', 62, '', '2010-07-26 18:08:42', 62, 0, '0000-00-00 00:00:00', '2010-07-25 14:41:41', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 2, 0, 2, '', '', 0, 7, 'robots=\nauthor='),
(37, 'Terceirizados', 'terceirizados', '', '<p> </p>\r\n<p>Os serviços de terceirização do Grupo Oriente contam com equipe altamente qualificada, treinada para atendimento a empresas, condomínios comerciais e industriais, assim o Grupo Oriente oferece um atendimento diferenciado para que sua empresa obtenha sucesso no mercado, sem precisar se preocupar com  a contratação e o gerenciamento de pessoas nos aspectos,  Técnicos , operacionais e administrativos:</p>', '', 1, 4, 0, 5, '2010-07-25 14:48:50', 62, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2010-07-25 14:48:50', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 4, '', '', 0, 9, 'robots=\nauthor='),
(38, 'Temporário / Estagiário', 'temporario-estagiario', '', '<p> </p>\r\n<p>Caracterizado por acúmulo de serviços ou por substituição de pessoas temporariamente afastadas das empresas, os serviços temporários são uma excelente opção quando o objetivo é agilidade em colocar pessoas para suprir necessidades transitórias. O Grupo Oriente empresa intermediária, habilitada à administração de trabalho temporário, além de recrutar e selecionar os profissionais mantém um cadastro de candidatos que podem ser encaminhados, com muita rapidez, para atenderem às solicitações das empresas clientes se responsabilizando, imediatamente, pela emissão de contratos, anotações em CTPS, pagamento de salários, recolhimento de encargos sociais e garantia dos direitos dos trabalhadores temporários, propiciando um melhor fluxo de atividades no Departamento de Pessoal do cliente.</p>\r\n<p>Vantagens:</p>\r\n<ul class="checkbox">\r\n<li>A utilização do trabalho temporário é legal (regulamentando por lei especial - 6.019/74)</li>\r\n<li>É um "atendimento de emergência" (oferece praticidade na contratação extra de pessoal) <br /></li>\r\n<li>O fato de evitar possíveis interrupções no trabalho efetivo (nos casos de férias, licença - maternidade, )</li>\r\n<li>Recruta, seleciona, admite e, posteriormente, dispensa funcionários</li>\r\n<li>Diminui custos com encargos determinados pela Lei</li>\r\n</ul>\r\n<p> </p>\r\n<p><strong>ESTAGIÁRIOS</strong></p>\r\n<p>Levamos até a sua empresa, jovens em formação nas melhores instituições de ensino, integrando-os ao mercado de trabalho;  <br />Administramos os estagiários, através dos processos de pagamento de bolsas e benefícios, conforme os requisitos legais.</p>', '', 1, 4, 0, 5, '2010-07-25 14:49:31', 62, '', '2010-07-26 17:43:59', 62, 0, '0000-00-00 00:00:00', '2010-07-25 14:49:31', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 2, 0, 3, '', '', 0, 8, 'robots=\nauthor='),
(39, 'Recrutamento e Seleção', 'recrutamento-e-selecao', '', '<p> </p>\r\n<p>Disponibilizamos para a sua empresa serviços de Recrutamento e Seleção de profissionais. Contamos com amplo banco de dados, o que nos possibilita a localização rápida e certa do profissional desejado.  <br />Nossa Equipe de Suporte ao Recrutamento e Seleção (Psicóloga e analista), auxiliará a sua empresa na definição do perfil do candidato ao cargo, possibilitando o desenvolvimento de um trabalho ajustado à demanda de sua empresa. <br />Para as empresas que querem um processo completo de recrutamento e seleção de pessoal,  O Grupo ORIENTE, realiza os seguintes serviços, conforme os interesses e necessidades de cada empresa e de acordo com as características de cada cargo</p>\r\n<ul class="checkbox">\r\n<li>Levantamento detalhado do perfil da posição / vaga</li>\r\n<li>Elaboração e divulgação de anúncios específicos;</li>\r\n<li>Triagem dos currículos e recrutamento dos profissionais</li>\r\n<li>Aplicação de testes, elaboração de laudos psicológicos e grafológicos,           aplicação de provas situacionais e dinâmicas de grupo</li>\r\n<li>Entrevistas individuais por competência e ou entrevistas coletivas</li>\r\n<li>Hunting (busca dirigida do talento para o cliente)</li>\r\n</ul>', '', 1, 4, 0, 5, '2010-07-25 14:51:48', 62, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2010-07-25 14:51:48', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 1, '', '', 0, 13, 'robots=\nauthor='),
(40, 'Desinsetização', 'desinsetizacao', '', '<p> </p>\r\n<p><strong>Desinsetização</strong>: Proporcionar o controle de insetos das instalações do estabelecimento, bem como no controle e prevenção, através de aplicação de produtos químicos e revisões sempre que se fizerem necessárias, num período de 30 dias, tempo de ação residual do produto aplicado.</p>\r\n<p><strong>Desinsetização área interna</strong>: Controle de insetos e outras pragas como: formiguinha ( formiguinha do açúcar ), pulgas, baratas ( germânica ) , traças, carrapatos,broca de madeira,cupin,carunchos, entre outras.</p>\r\n<p><strong>Desinsetização área externa</strong>, incluindo o controle de carrapatos, aranhas, escorpiões, pulgas, baratas ,ratos,entre outras espécies.</p>\r\n<p><strong>Micro pulverização</strong>: Aplicação da calda de inseticida em todos os pontos possíveis de infestação. Age por ação imediata e cria uma camada residual do produto.</p>\r\n<p><strong>Aplicação de superfície</strong>: Aplicação da calda de inseticida cobrindo inteiramente as superfícies por onde passam os insetos, através de bombas costais e bicos especiais. Tratamento com gel: Produto inodoro, antialérgico e aplicado dentro de armários, debaixo de mesas, dobradiças e demais pontos estratégicos. Excelente efeito para baratas. Não é preciso sair do ambiente.</p>\r\n<p>Atendemos   Indústrias, hospitais, órgãos públicos, condomínios, supermercados, hotéis, bares, restaurantes, padarias, empresas de ônibus, residências, entre outros.<br />Vale a pena investir em um serviço especializado, pois só desta maneira sua residência, empresa ou indústria estará protegida.</p>', '', 1, 4, 0, 5, '2010-07-25 14:55:12', 62, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2010-07-25 14:55:12', '0000-00-00 00:00:00', '', '', 'show_title=\nlink_titles=\nshow_intro=\nshow_section=\nlink_section=\nshow_category=\nlink_category=\nshow_vote=\nshow_author=\nshow_create_date=\nshow_modify_date=\nshow_pdf_icon=\nshow_print_icon=\nshow_email_icon=\nlanguage=\nkeyref=\nreadmore=', 1, 0, 5, '', '', 0, 20, 'robots=\nauthor='),
(41, 'Candidatos', 'candidatos', '', '<p> </p>\r\n<p>Se você é um candidato e está em busca de uma boa colocação, não deixe de cadastrar e atualizar sempre seu currículo; ele é o seu passaporte para as grandes oportunidades!</p>\r\n<table border="0" cellpadding="6" cellspacing="6" width="100%">\r\n<tbody>\r\n<tr>\r\n<td style="width: 50%;" align="center" valign="middle"><a target="_blank" href="http://www.informatechsistemas.com.br/oriente/cadastrar"><img style="border-color: #000000; border-width: 0px;" alt="Cadastre seu currículo" src="http://www.informatechsistemas.com.br/oriente/images/cadastrar.gif" /></a></td>\r\n<td style="width: 50%;" align="center" valign="middle"><a target="_blank" href="http://www.informatechsistemas.com.br/oriente/todas_oportunidades"><img style="border-color: #000000; border-width: 0px;" alt="Oportunidades" src="http://www.informatechsistemas.com.br/oriente/images/oportunidades.gif" /></a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Se você é uma empresa e está interessado em recrutar candidatos de forma ágil e eficiente, consulte-nos; nós temos os melhores candidatos para o seu negócio!</p>\r\n<table border="0" cellpadding="6" cellspacing="6" width="100%">\r\n<tbody>\r\n<tr>\r\n<td style="width: 50%;" align="center" valign="middle"><a href="index.php?option=com_chronocontact&amp;Itemid=52"><img style="border-color: #000000; border-width: 0px;" alt="cadastrar" src="images/stories/cadastrar.png" height="84" width="168" /></a></td>\r\n<td style="width: 50%;" align="center" valign="middle"><a href="index.php?option=com_chronocontact&amp;Itemid=54"><img style="border-color: #000000; border-width: 0px;" alt="visita" src="images/stories/visita.png" height="84" width="168" /></a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style="text-align: center;"><img style="border-color: #000000; border-width: 0px;" alt="servicos" src="images/stories/servicos.jpg" height="137" width="658" /></p>', '', 1, 0, 0, 0, '2010-07-25 15:52:55', 62, '', '2010-07-25