(2, 'Currículo', '<div class=\\"componentheading\\">{global:formtitle}</div>\r\n<table border=\\"0\\">\r\n	<tr>\r\n		<td>{Cabecalho:caption}</td>\r\n		<td>{Cabecalho:body}<div class=\\"clr\\"/>{Cabecalho:validation}</td>\r\n		<td>{Cabecalho:description}</td>\r\n	</tr>\r\n	<tr>\r\n		<td>{Dados Pessoais:caption}</td>\r\n		<td>{Dados Pessoais:body}<div class=\\"clr\\"/>{Dados Pessoais:validation}</td>\r\n		<td>{Dados Pessoais:description}</td>\r\n	</tr>\r\n	<tr>\r\n		<td>{Foto:caption}</td>\r\n		<td>{Foto:body}<div class=\\"clr\\"/>{Foto:validation}</td>\r\n		<td>{Foto:description}</td>\r\n	</tr>\r\n	<tr>\r\n		<td>{Nome Completo:caption} (*)</td>\r\n		<td>{Nome Completo:body}<div class=\\"clr\\"/>{Nome Completo:validation}</td>\r\n		<td>{Nome Completo:description}</td>\r\n	</tr>\r\n	<tr>\r\n		<td>{Nacionalidade:caption}</td>\r\n		<td>{Nacionalidade:body}<div class=\\"clr\\"/>{Nacionalidade:validation}</td>\r\n		<td>{Nacionalidade:description}</td>\r\n	</tr>\r\n	<tr>\r\n		<td>{Data de Nascimento:caption}</td>\r\n		<td>{Data de Nascimento:body}<div class=\\"clr\\"/>{Data de Nascimento:validation}</td>\r\n		<td>{Data de Nascimento:description}</td>\r\n	</tr>\r\n	<tr>\r\n		<td>{Naturalidade:caption}</td>\r\n		<td>{Naturalidade:body}<div class=\\"clr\\"/>{Naturalidade:validation}</td>\r\n		<td>{Naturalidade:description}</td>\r\n	</tr>\r\n	<tr>\r\n		<td>{Estado Civil:caption}</td>\r\n		<td>{Estado Civil:body}<div class=\\"clr\\"/>{Estado Civil:validation}</td>\r\n		<td>{Estado Civil:description}</td>\r\n	</tr>\r\n	<tr>\r\n		<td>{Nr. Filhos:caption}</td>\r\n		<td>{Nr. Filhos:body}<div class=\\"clr\\"/>{Nr. Filhos:validation}</td>\r\n		<td>{Nr. Filhos:description}</td>\r\n	</tr>\r\n	<tr>\r\n		<td>{Endereço:caption}</td>\r\n		<td>{Endereço:body}<div class=\\"clr\\"/>{Endereço:validation}</td>\r\n		<td>{Endereço:description}</td>\r\n	</tr>\r\n	<tr>\r\n		<td>{Cidade UF:caption}</td>\r\n		<td>{Cidade UF:body}<div class=\\"clr\\"/>{Cidade UF:validation}</td>\r\n		<td>{Cidade UF:des